import React from "react";
import { MDBCol, MDBContainer, MDBRow, MDBFooter } from "mdbreact";

const FooterPage = () => {
  return (
    <MDBFooter color="blue" className="font-small pt-4 mt-4">

          <div class="footer">
            <div class="footer-links">
              <a href="https://nick-ang.github.io/profile/" target="_blank">
                <i class="fab fa-github"></i>
              </a>
              <a href="https://www.instagram.com/nickangg/" target="_blank">
                <i class="fab fa-instagram"></i>
              </a>
              <a href="https://www.linkedin.com/in/nick-c-ang/" target="_blank">
                <i class="fab fa-linkedin"></i>
              </a>
            </div>
            <div class="footer-copyright">
              Made with <i class="fas fa-heart"></i> by Nick Ang
            </div>
          </div>

      <div className="footer-copyright text-center py-3">
        <MDBContainer fluid>
          &copy; {new Date().getFullYear()} Copyright:{" "}
          <a href="https://www.linkedin.com/in/nick-c-ang/">
            {" "}
            Made by Nick Ang{" "}
          </a>
        </MDBContainer>
      </div>
    </MDBFooter>
  );
};

export default FooterPage;
